// GaussdbLexerInit initializes any static state used to implement GaussdbLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewGaussdbLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func GaussdbLexerInit() {
	staticData := &GaussdbLexerLexerStaticData
	staticData.once.Do(gaussdblexerLexerInit)
}

// NewGaussdbLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewGaussdbLexer(input antlr.CharStream) *GaussdbLexer {
	GaussdbLexerInit()
	l := new(GaussdbLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &GaussdbLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "GaussdbLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

